import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'

import GroupForm from "./forms/GroupForm";
import TeacherForm from "./forms/TeacherForm";
import ClassroomForm from "./forms/ClassroomForm";
import ClassroomReport from "./reports/ClassroomReport";
import TeacherReport from "./reports/TeacherReport";
import Layout from "./components/Layout";

const Home = () => {

  return (
    <Layout>

      <Router>
        <Routes>
          <Route exact path="/classrooms/form" element={<ClassroomForm />} />
          <Route exact path="/groups/form" element={<GroupForm />} />
          <Route exact path="/teachers/form" element={<TeacherForm />} />

          <Route exact path="/classrooms/" element={<ClassroomReport />} />
          <Route exact path="/teachers/" element={<TeacherReport />} />
        </Routes>
      </Router>

    </Layout>
  );
};

ReactDOM.render(<Home />, document.getElementById("root"));
